import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Electronics category card (home grid)
    const electronicsCardSelector = '.category-card:has-text("Electronics")';
    await page.waitForSelector(electronicsCardSelector, { timeout: 5000 });

    // Click the Electronics category card
    await page.click(electronicsCardSelector);

    // Wait for the category results header or grid to appear
    // Try a few selector strategies for robustness
    let categoryHeader;
    try {
      categoryHeader = await page.waitForSelector('h2:text("Electronics")', { timeout: 5000 });
    } catch {
      // Fallback: look for grid with electronics products
      await page.waitForSelector('.products-grid', { timeout: 5000 });
    }

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Extract product titles in the Electronics category grid
    const productTitles = await page.$$eval('.products-grid .product-title', els =>
      els.map(el => el.textContent.trim())
    );

    // Extract the category header text if present
    let categoryTitle = '';
    try {
      categoryTitle = await page.$eval('h2', el => el.textContent.trim());
    } catch {
      categoryTitle = '';
    }

    return {
      success: true,
      action: "Navigated to the Electronics category via the category card on the homepage",
      extractedData: {
        categoryTitle,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
